  true,\n\t\"url\": null,\n\t\"notes\": \"This Congressional report summarizes the
  implementation and evaluation of two approaches tested in the summers of 2011 through
  2013. Summer EBT for Children (SEBTC) uses existing electronic benefits transfer
  systems to provide household benefits for children.  The Enhanced Summer Food Service
  Program (eSFSP) tests several changes to the traditional program, including incentives
  to extend operating periods, incentives to add enrichment activities, meal delivery
  for children in rural areas, and weekend and holiday backpacks.\",\n\t\"owner_org\":
